import React from "react";
import Table_column_child from "./Table_column_child";

function Table_flesh(props){
    console.log("Table_flesh")

    return(
    <div  className={`${props.classN}`} >

        <Table_column_child 
            p_yakliki={props.p_yakliki} s_yakliki={props.s_yakliki} calcule={props.calcule} num={props.num} boy_p={props.boy_p} boy_s={props.boy_s} table_column_children="border-bottom column_child_1_4_5_8" />
            
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>a</div>
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>b</div>
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>c</div>
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>d</div>
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>e</div>
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>f</div>
       <div className={`${props.child} d-flex justify-content-center align-items-center border-dark`}>i</div>
       <div className={`${props.child} d-flex justify-content-center align-items-center`}></div>
    </div>
    )
}

export default React.memo(Table_flesh) ;
